script: |
  super -f text -I q1823.spq | sort > q1823.out

inputs:
  - name: q1823.spq
    data: |
      SELECT - - 32 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT 16 IN ( - + col0, col2, + - col2, col0, - 54, - col1 - - 24 );
  - name: tab0

outputs:
  - name: q1823.out
    data: |
      32
      32
      32
